import classNames from "classnames/bind";

import styles from "./Edit.module.scss";

const cx = classNames.bind(styles);

function editResult() {
    return (
        <section className= {cx("Container")}>
            <section className={cx("result")}>
                
            </section>
        </section>
    );
}

export default editResult;
